import React, { useState, useEffect } from "react";

export default function AdminDashboard() {
  const [foods, setFoods] = useState([]);
  const [categories, setCategories] = useState([]);

  useEffect(() => {
    const fetchFoods = async () => {
      try {
        const response = await fetch("/api/foods"); // Assuming your API endpoint is '/api/foods'
        const data = await response.json();
        setFoods(data);
      } catch (error) {
        console.error("Error fetching foods:", error);
      }
    };

    const fetchCategories = async () => {
      try {
        const response = await fetch("/api/category"); // Assuming your API endpoint is '/api/category'
        const data = await response.json();
        setCategories(data);
      } catch (error) {
        console.error("Error fetching categories:", error);
      }
    };

    fetchFoods();
    fetchCategories();
  }, []);

  return (
    <div>
      <h2>Admin Dashboard</h2>
      <div>
        <h3>Foods:</h3>
        <div className="card-container">
          {foods.map((food) => (
            <div className="card" key={food._id}>
              <h4>{food.name}</h4>
              <p>{food.description}</p>
              <p>Price: ${food.price}</p>
              {/* Add more details as needed */}
            </div>
          ))}
        </div>
      </div>
      <div>
        <h3>Categories:</h3>
        <div className="card-container">
          {categories.map((category) => (
            <div className="card" key={category._id}>
              <h4>{category.category}</h4>
              <p>{category.description}</p>
              {/* Add more details as needed */}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
